script: |
  super -f text -I q543.spq | sort > q543.out

inputs:
  - name: q543.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 IN ( + - 58 + col1, + col2, - + 47, - 11 * + col0 - col1 );
  - name: tab2

outputs:
  - name: q543.out
    data: |
      46	51	23
      64	77	40
      75	67	58
